    hash = hash::Sha512_256Algorithm().calculate("abcdefghijklmnopqrstuvwx"); GTEST_ASSERT_EQ(hash->to_string(), "691a7d318f32e200109c3ae93c50ec16993b44c2f197ea20807f552cb98ed820"); delete hash;
