    hash = hash::Sha512_256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz1234567890abcdefghijklmnop"); GTEST_ASSERT_EQ(hash->to_string(), "fe002f7cc97685871f39d84ff925b70211d96c5ee607a78b78b8172e8ba3506b"); delete hash;
